import { React, useState, useEffect } from 'react';
import styles from './usercard.module.css';
import Sidebar from '../sidebar';
import API from '../../../api';


function Newuser() {

    const [username, setUsername] = useState();
    const [password, setPassword] = useState();
    const [email, setEmail] = useState();
    const [profilepic, setProfilepic] = useState();

    const adduser = () => {

        try {

            const body =
            {
                username: username,
                password: password,
                mail: email,
                profilepic: profilepic,
            };

            console.log();

            API.post(`users`, body).then((res) => {
                const result = res.data;
            });

        } catch (e) {
            console.log(e);
        }
    }

    return (

        <div className={styles.adduserwrapper}>

            <Sidebar />

            <form action="" className={styles.newuserform}>


                <label htmlFor="username" className={styles.adduserlabel}>
                    Username :
                    <input className="inputu" type="text" name="username" onChange={(e) => { setUsername(e.target.value) }} />
                </label>


                <label htmlFor="email" className={styles.adduserlabel}>
                    Email :
                    <input className="inputu" type="email" name="email" onChange={(e) => { setEmail(e.target.value) }} />
                </label>


                <label htmlFor="password" className={styles.adduserlabel}>
                    Password :
                    <input className="inputu" type="password" name="password" onChange={(e) => { setPassword(e.target.value) }} />
                </label>

                <div>
                    <label htmlFor="pic" className={styles.adduserlabel}>
                        choose image :
                        <input style={{ display: 'block', margin: 'auto' }} type="file" name="pic" onChange={(e) => { setProfilepic(e.target.value) }} />
                    </label>
                </div>

                <div>
                    <input type="submit" value="Add" />
                </div>

            </form>

        </div>

    )
}

export default Newuser;
